import './SwiperExample.css';

import Image1 from '../Swiper/Image/image1.webp';
import Image2 from '../Swiper/Image/image2.webp';
import Image3 from '../Swiper/Image/image3.webp';

import { Col, Container, Row } from 'react-bootstrap';

function SwiperExample(){
    return(
        <Container fluid>
            <Row>
                <Col xl = "3" lg = "3" md = "6" sm = "12">
                    <div className = "card-wrapper">
                        <img src = {Image1} className = "w-100 h-100"/>
                        <button className = "card-button">Shop Now</button>
                    </div>
                </Col>
            </Row>
        </Container>
    )
}

export default SwiperExample
